    data: |
      SELECT DISTINCT tab1.col0 + - cor0.col0 AS col2 FROM tab2 (FORMAT parquet) AS cor0 CROSS JOIN tab1 (FORMAT parquet);
  - name: tab1
  - name: tab2

outputs:
